// Clears all the variables so they can be used again. Basically sets them to null
function updateVariables() {
	//Creates an array to store all the words from the text boxes
	words;
	//Creates a new array to be used below for making a list of all words
	wordSpace = [];
	//Creates a new array to make a list of all the positive words
	posWords = [];
	//Creates a new array to make a list of all the negative words
	negWords = [];
	//Creates a scoring variable to track the total score of the words
	score = 0;
	//Creates an array with the score over the course of the text
	scoreTime = [];
	//Creates an array to count the number of negative words
	negativeCount = [];
	//Creates an array to count the number of positive words
	positiveCount = [];
	//Creates an array to count the number of undefined words
	neutralCount = [];
	//Creates an array to count unique words for the word clouds
	wordCloud = [];
	//Creates an array to count the number of curse words in the text
	curseCount = [];
	//Creates a variable to hold the word that users can search stats for
	userInput = 0;
	userInputCount = [];
}

// Breaks down the text in the text box so it's usable
function submitText() {
	//Grabs the value from the text box
	var txtInput = document.getElementById("txtBox").value;
	//Splits up the text by anything that's not a character
	words = txtInput.split(/\W/);

	scoreTheWords();
	updateWebsite();
}

// Breaks down the word the user puts in the search box so it's usable
function userWordSearch() {
	userInput = document.getElementById("userSearch").value;
	userInput = userInput.toLowerCase();
	searchStats();
}


// Assigns values to the words and does some calculations (mostly addition)
function scoreTheWords() {
	//Sets all the variables back to nothing so this can run fresh with new words and not duplicate stuff
	updateVariables();
	//Goes through and makes a list of all the words from text box
	var n = 0;
	var nn = 0;
	var no = 0;
	var np = 0;
	var nc = 0;
	for (var i = 0; i < words.length; i++) {
		var oneWord = words[i].toLowerCase();
		//Check if the word exists in the AFINN word list
		if(AFINN[oneWord]){
			//Updates the score with the value of a word from AFINN
			score += Number(AFINN[oneWord]);
			//Creates an array of all the words listed and their values
			wordSpace[n] = " " + oneWord + ": " + AFINN[oneWord].toFixed(2);
			//Adds the value of score to a new array point each time a word is detected
			scoreTime[n] = score.toFixed(2);
			n++;
			
			//Creates an array to count all of the positive words from the second textbox and make an array of their values
			if(AFINN[oneWord] > 0){
				posWords[np] = oneWord + ": " + (AFINN[oneWord]).toFixed(2);
				positiveCount[np] = AFINN[oneWord];
				np++;
			}
			//Creates an array to count all of the negative words from the second textbox and make an array of their values
			if(AFINN[oneWord] < 0){
				negWords[nn] = oneWord + ": " + (AFINN[oneWord]).toFixed(2);
				negativeCount[nn] = AFINN[oneWord];
				nn++;
			}
		//If the word does not exist in the AFINN list, then it assigns the word to an array of neutral words
		} else {
			neutralCount[no] = " " + oneWord;
			no++;
		}
		//Checks to see if the word exists in the curseWord database and creates an array of those words
		if(curseWords[oneWord]){
			curseCount[nc] = " " + oneWord;
			nc++;
		}
	}
	//Creates an array of unique words from an array
	var uniqueAllWords = words.filter(function(item, pos){
		return words.indexOf(item)== pos; 
	});

	//Goes through all of the words and gives counts to the unique words from textbox 1
	for(var i = 0; i < uniqueAllWords.length; i++){
		var c = 0;
		for(var j = 0; j < words.length; j++){
			if(uniqueAllWords[i] == words[j]){
				 c++
			}
		}
		wordCloud[i] = uniqueAllWords[i] + ": " + c;
	}
	console.log(wordCloud);
}

// Searches the text for a word that the user chooses
function searchStats() {
	var c = 0;
	for (var i = 0; i < words.length; i++) {
		var oneWord = words[i].toLowerCase();
		var before = i - 1;
		var after = i + 1;
		if(oneWord == userInput){
			userInputCount[c] = i;
			c++;
			//Searches for all the words before the word that is searched
			if(after < words.length){
				var wordAfter = words[after].toLowerCase();
				console.log("After: " + wordAfter);
			}
			//Searches for all the words after the word that is searched
			if(before >= 0){
				var wordBefore = words[before].toLowerCase();
				console.log("Before: " + wordBefore);
			}
		}
	}
	//Set the text for the count of instances of the searched word
	document.getElementById("countSearch").innerHTML = "Source 1 Total: " + userInputCount.length;
	}

// Changes the text on the website to show the numbers calculated by earlier functions
function updateWebsite() {
	//Updates the text below the first box with the data that I want to know
	var scoreV = "Total Score: " + score.toFixed(2);
	document.getElementById("score").innerHTML = scoreV;
	var compV = "Average Score: " + (score / wordSpace.length).toFixed(2); //Divides the score by the number of 'coded' words that exist (does not consider neutral words)
	document.getElementById("average").innerHTML = compV;
	document.getElementById("totalWords").innerHTML = "Total words: " + words.length;
	//Displays the neutral word data
	var neutPercV = "% Neutral words: " + ((neutralCount.length/words.length)*100).toFixed(2) + "%";
	document.getElementById("neutPerc").innerHTML = neutPercV;
	document.getElementById("neutCount").innerHTML = "# Neutral words: " + neutralCount.length;
	//Displays the fun word data	
	var posPercV = "% Fun words: " + ((positiveCount.length/words.length)*100).toFixed(2) + "%";
	document.getElementById("posPerc").innerHTML = posPercV;
	document.getElementById("posCount").innerHTML = "# Fun words: " + positiveCount.length;
	//Displays the boring word data
	var negPercV = "% Boring words: " + ((negativeCount.length/words.length)*100).toFixed(2) + "%";
	document.getElementById("negPerc").innerHTML = negPercV;
	document.getElementById("negCount").innerHTML = "# Boring words: " + negativeCount.length;
	//Displays the curse word data
	var cursePercV = "% Curse words: " + ((curseCount.length/words.length)*100).toFixed(2) + "%";
	document.getElementById("cursePerc").innerHTML = cursePercV;
	document.getElementById("curseCount").innerHTML = "# Curse words: " + curseCount.length;
	//Displays time series data
	//document.getElementById("timeSeries").innerHTML = "Time Series: " + scoreTime;
	
	var wordlistV = "Fun/Boring List: " + wordSpace;
	var posWordlistV = "Fun List: " + posWords;
	var negWordlistV = "Boring List: " + negWords;
	var neutralWordlistV = "Neutral List: " + neutralCount;
	var curseWordlistV = "Curse List: " + curseCount;
	document.getElementById("wordlist").innerHTML = wordlistV;
	document.getElementById("posWordlist").innerHTML = posWordlistV;
	document.getElementById("negWordlist").innerHTML = negWordlistV;
	document.getElementById("curseWordlist").innerHTML = curseWordlistV;
	document.getElementById("neutralWordlist").innerHTML = neutralWordlistV;
}

// Creates the graphs
function createChart() {
	var ctx1 = document.getElementById('myChart').getContext('2d');
	var ctx2 = document.getElementById('myChart2').getContext('2d');
	var ctx3 = document.getElementById('myChart3').getContext('2d');
	var ctx4 = document.getElementById('myChart4').getContext('2d');
	
	// Bar chart to show the total score
	var chart1 = new Chart(ctx1, {
		// The type of chart we want to create
		type: 'bar',
		// The data for our dataset
		data: {
			labels: ["Source 1"],
			datasets: [{
				label: "Average Score",
				backgroundColor: ['rgba(232,69,69,0.5)', 'rgba(43,46,74,0.5)'],
				borderColor: ['rgb(232,69,69)', 'rgb(43,46,74)'],
				borderWidth: 1,
				data: [score],
				}]
		},
		// Configuration options go here
		options: {
			legend: {
				display: false,
			},
			title: {
				display: true,
				text: "Average Score"
			},
			scales: {
				yAxes: [{
					ticks: {
						beginAtZero:true
					}
				}]
			}
		}
	})
	var xValue1 = [];
	var xValue2 = [];
	var labelForChart;
	//Creates arrays chronologically numbered for the xAxis
	for(var i = 0; i < scoreTime.length; i++){
		xValue1[i] = i;
	}
	//Checks to see which Source has more instances of scored words to set the xAxis
	if(xValue1 > xValue2){
		labelForChart = xValue1;
	} else {
		labelForChart = xValue2;
	}
	
	// Line chart showing the overall score over time
	var chart2 = new Chart(ctx2, {
		// The type of chart we want to create
		type: 'line',
		// The data for our dataset
		data: {
			labels: labelForChart,
			datasets: [{
				fill: false,
				label: "Source 1",
				borderColor: 'rgb(232,69,69)',
				backgroundColor: 'rgb(232,69,69)',
				pointRadius: 0,
				data: scoreTime,
				}]
		},
		// Configuration options go here
		options: {
			title: {
				display: true,
				text: "Sentiment over Time"
			},
			//showLine: false,
			scales: {
				yAxes: [{
					ticks: {
						beginAtZero:true
					}
				}]
			}
		}
	})
	
	//Donut chart showing the percent of fun and boring words for Source 1
	var percentPos = positiveCount.length / (positiveCount.length + negativeCount.length);
	var percentNeg = negativeCount.length / (positiveCount.length + negativeCount.length);
	var chart3 = new Chart(ctx3, {
		// The type of chart we want to create
		type: 'doughnut',
		// The data for our dataset
		data: {
			labels: ["Fun", "Boring"],
			datasets: [{
				borderColor: ['rgb(0,173,181)', 'rgb(255,57,34)'],
				backgroundColor: ['rgb(0,173,181)', 'rgb(255,57,34)'],
				data: [percentPos, percentNeg],
				}]
		},
		// Configuration options go here
		options: {
			title: {
				display: true,
				text: "Source 1"
			},
		}
	})
}

// Sets up the left arrow key to create the graphs
function leftPress(){
	//Detects if a key is clicked (specifically, the left arrow)
	document.addEventListener("keyup", function(event) {
	event.preventDefault();
		if (event.keyCode == 37) {
			//Runs a function when the left key is pressed
			//assignFile();
			createChart();
		};
	});
}

//Starts the function to listen for a left arrow key press
leftPress();




























